import React from 'react';

const addUser = () => {
    return(
        <div className='pa2'>
        <input
          className='pa3 ba b--green bg-lightest-blue'
          type='text'
          name='name'
          placeholder='Name'
          onChange={this.handleChange}
        />
        <input
          className='pa3 ba b--green bg-lightest-blue'
          type='text'
          name='email'
          placeholder='Email'
          onChange={this.handleChange}
        />
        <input
          className='pa3 ba b--green bg-lightest-blue'
          type='text'
          name='ID'
          placeholder='ID'
          onChange={this.handleChange}
        />
        <button>Sumbet</button>
        
    </div>
    );
}

export default addUser;
